import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import "./App.css";
import AppBar from "components/AppBar";
import MasterPage from "pages/MasterPage";
import ReimbursementDetail from "pages/ReimbursementDetail"; // Import the detail page component

const App = () => {
  return (
    <Router>
      <div className="App full-height">
        <AppBar />
        <Routes>
          {/* Route for the master page */}
          <Route path="/" element={<MasterPage />} />

          {/* Route for the reimbursement detail page */}
          <Route path="/reimbursement/:id" element={<ReimbursementDetail />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
